@ChristoPy_ @WishinSolidao O navegador é mais espertão, ele sabe que ta vindo em pedaços a resposta e vai mostrando em pedaços.

É assim que o ChatGPT escreve as respostas dele. Mas lembre-se: tem começo, meio e fim.

Se é uma conexão que se mantém aberta, tipo, pra sempre, recomendo WebSockets.
